import React, { useState } from 'react';
import './Dropdowns.css'; // Import your custom styling for the dropdowns

const Dropdowns = () => {
  const options = Array.from({ length: 12 }, (_, i) => `Option ${i + 1}`);

  const [selectionOne, setSelectionOne] = useState(options[0]);
  const [selectionTwo, setSelectionTwo] = useState(options[0]);

  const handleDropdownChange = (event, setSelection) => {
    setSelection(event.target.value);
  };

  return (
    <div className="dropdown-container">
      <div className="dropdown">
        <label htmlFor="dropdownOne">Dropdown One:</label>
        <select
          id="dropdownOne"
          value={selectionOne}
          onChange={(e) => handleDropdownChange(e, setSelectionOne)}
        >
          {options.map((option, index) => (
            <option key={index} value={option}>
              {option}
            </option>
          ))}
        </select>
      </div>
      <div className="dropdown">
        <label htmlFor="dropdownTwo">Dropdown Two:</label>
        <select
          id="dropdownTwo"
          value={selectionTwo}
          onChange={(e) => handleDropdownChange(e, setSelectionTwo)}
        >
          {options.map((option, index) => (
            <option key={index} value={option}>
              {option}
            </option>
          ))}
        </select>
      </div>
    </div>
  );
};

export default Dropdowns;
